import React from 'react';

function Footer() {
  return (
    <footer className="bg-light py-4 mt-5">
      <div className="container text-center">
        <p>&copy; 2024 My Portfolio. All rights reserved.</p>
      </div>
    </footer>
  );
}

export default Footer;
